import sys

def is_bingo(bingo_card, numbers):
    """
    @type bingo_card: list[list[int]]
    @type numbers: list[int]
    @rtype: bool
    """
    bingo_card = [list(map(lambda x: 0 if x in numbers else x, row)) for row in bingo_card]
    if bingo_card[0][0] == 0 and bingo_card[1][1] == 0 and bingo_card[2][2] == 0:
        return True
    if bingo_card[0][2] == 0 and bingo_card[1][1] == 0 and bingo_card[2][0] == 0:
        return True
    for row in bingo_card:
        if row[0] == 0 and row[1] == 0 and row[2] == 0:
            return True
    for column in zip(*bingo_card):
        if column[0] == 0 and column[1] == 0 and column[2] == 0:
            return True
    return False

def main():
    bingo_card = [list(map(int, l.split())) for l in sys.stdin.readlines()[:3]]
    numbers = list(map(int, sys.stdin.readlines()[4:]))
    if is_bingo(bingo_card, numbers):
        print("Yes")
    else:
        print("No")

if __name__ == "__main__":
    main()

import sys

def bingo(card, numbers):
    # check rows
    for i in range(3):
        if len(set(card[i]).intersection(numbers)) == 3:
            return True

    # check columns
    for i in range(3):
        if len(set([card[j][i] for j in range(3)]).intersection(numbers)) == 3:
            return True

    # check diagonals
    if len(set([card[i][i] for i in range(3)]).intersection(numbers)) == 3:
        return True
    if len(set([card[i][2-i] for i in range(3)]).intersection(numbers)) == 3:
        return True

    return False

def main():
    card = []
    for i in range(3):
        card.append(list(map(int, sys.stdin.readline().strip().split())))

    num_numbers = int(sys.stdin.readline().strip())
    numbers = []
    for i in range(num_numbers):
        numbers.append(int(sys.stdin.readline().strip()))

    if bingo(card, numbers):
        print("Yes")
    else:
        print("No")

if __name__ == "__main__":
    main()

def bingo(a, b):
    """
    Return whether there is a bingo.
    :param a: 2D list
    :param b: 1D list
    :return: bool
    """
    # Make a set for each row and column
    row = [set() for _ in range(3)]
    col = [set() for _ in range(3)]
    # Make a set for the two diagonals
    diag = [set(), set()]
    # Iterate through the bingo card and mark the numbers that are in b
    for i in range(3):
        for j in range(3):
            if a[i][j] in b:
                row[i].add(a[i][j])
                col[j].add(a[i][j])
                if i == j:
                    diag[0].add(a[i][j])
                if i + j == 2:
                    diag[1].add(a[i][j])
    # Check whether there is a bingo
    bingo = False
    for i in range(3):
        if len(row[i]) == 3 or len(col[i]) == 3:
            bingo = True
            break
    if not bingo:
        for diag_set in diag:
            if len(diag_set) == 3:
                bingo = True
                break
    return bingo


def main():
    # Read input from stdin
    a = []
    for _ in range(3):
        a.append(list(map(int, input().split())))
    n = int(input())
    b = []
    for _ in range(n):
        b.append(int(input()))
    # Print output
    if bingo(a, b):
        print('Yes')
    else:
        print('No')


if __name__ == '__main__':
    main()
